import { jsPDF } from "jspdf";
var font =
  "";

export const registerFonts2 = () => {
  jsPDF.API.events.push([
    "addFonts",
    function () {
      this.addFileToVFS("Outfit-ExtraBold-bold.ttf", font);
      this.addFont("Outfit-ExtraBold-bold.ttf", "Outfit-ExtraBold", "bold");
    },
  ]);
};
